contracts/ContestFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
// Using existing DEPE token at 0x37e0f2d2340968981ed82d47c0112b1619dc5b07
import "./ContestInstance.sol";

/**
 * @title Contest Factory Contract
 * @dev Factory contract for creating DEPE meme contests
 * @author DEPE Team
 * 
 * Features:
 * - Creates new contest instances
 * - Validates contest parameters
 * - Manages contest fees
 * - Tracks all contests
 * - Emergency controls
 */
contract ContestFactory is Ownable, ReentrancyGuard, Pausable {
    using SafeMath for uint256;

    // Contract addresses
    address public depeToken; // Existing DEPE token at 0x37e0f2d2340968981ed82d47c0112b1619dc5b07
    address public platformWallet;
    
    // Contest configuration
    uint256 public constant MIN_POOL_USD = 50 * 10**18; // $50 USD minimum
    uint256 public constant MAX_CONTEST_DURATION = 7 days;
    uint256 public constant MIN_CONTEST_DURATION = 1 days;
    uint256 public constant PLATFORM_FEE_BPS = 1000; // 10% platform fee
    
    // Contest tracking
    uint256 public totalContests;
    mapping(uint256 => address) public contests;
    mapping(address => uint256[]) public userContests;
    
    // Price feed for USD conversion (simplified - in production use Chainlink)
    uint256 public depePriceUSD = 0.0014 * 10**18; // $0.0014 per DEPE (example)
    
    // Events
    event ContestCreated(
        uint256 indexed contestId,
        address indexed contestAddress,
        address indexed creator,
        uint256 memePoolAmount,
        uint256 minEntriesRequired,
        uint256 duration
    );
    event PlatformWalletUpdated(address indexed oldWallet, address indexed newWallet);
    event DEPEPriceUpdated(uint256 oldPrice, uint256 newPrice);
    event ContestFeeCollected(uint256 indexed contestId, uint256 amount);

    // Modifiers
    modifier validAddress(address _address) {
        require(_address != address(0), "ContestFactory: Invalid address");
        _;
    }

    modifier validAmount(uint256 _amount) {
        require(_amount > 0, "ContestFactory: Amount must be positive");
        _;
    }

    /**
     * @dev Constructor
     * @param _depeToken DEPE token contract address
     * @param _platformWallet Platform wallet address
     */
    constructor(
        address _depeToken,
        address _platformWallet
    ) {
        require(_depeToken != address(0), "ContestFactory: Invalid DEPE token");
        require(_platformWallet != address(0), "ContestFactory: Invalid platform wallet");
        
        depeToken = _depeToken; // Existing DEPE token address
        platformWallet = _platformWallet;
    }

    /**
     * @dev Create a new contest
     * @param memePoolAmount Amount of DEPE for meme pool
     * @param minEntriesRequired Minimum entries required for contest to be valid
     * @param duration Contest duration in seconds
     * @param title Contest title
     * @param description Contest description
     * @return contestAddress Address of the created contest
     */
    function createContest(
        uint256 memePoolAmount,
        uint256 minEntriesRequired,
        uint256 duration,
        string memory title,
        string memory description
    ) 
        external 
        nonReentrant 
        whenNotPaused 
        validAmount(memePoolAmount)
        returns (address contestAddress) 
    {
        // Validate parameters
        require(minEntriesRequired >= 1 && minEntriesRequired <= 1000, "ContestFactory: Invalid min entries");
        require(duration >= MIN_CONTEST_DURATION && duration <= MAX_CONTEST_DURATION, "ContestFactory: Invalid duration");
        require(bytes(title).length > 0 && bytes(title).length <= 200, "ContestFactory: Invalid title");
        require(bytes(description).length <= 500, "ContestFactory: Description too long");
        
        // Validate minimum pool amount ($50 USD)
        uint256 minPoolDEPE = MIN_POOL_USD.mul(10**18).div(depePriceUSD);
        require(memePoolAmount >= minPoolDEPE, "ContestFactory: Pool below minimum $50 USD");
        
        // Calculate platform fee
        uint256 platformFee = memePoolAmount.mul(PLATFORM_FEE_BPS).div(10000);
        uint256 netPoolAmount = memePoolAmount.sub(platformFee);
        
        // Transfer DEPE tokens from creator
        require(
            IERC20(depeToken).transferFrom(msg.sender, address(this), memePoolAmount),
            "ContestFactory: Transfer failed"
        );
        
        // Transfer platform fee
        if (platformFee > 0) {
            require(
                IERC20(depeToken).transfer(platformWallet, platformFee),
                "ContestFactory: Platform fee transfer failed"
            );
        }
        
        // Create new contest instance
        ContestInstance newContest = new ContestInstance(
            address(depeToken),
            msg.sender,
            netPoolAmount,
            minEntriesRequired,
            duration,
            title,
            description
        );
        
        // Transfer net pool amount to contest
        require(
            IERC20(depeToken).transfer(address(newContest), netPoolAmount),
            "ContestFactory: Contest funding failed"
        );
        
        // Track contest
        uint256 contestId = totalContests;
        contests[contestId] = address(newContest);
        userContests[msg.sender].push(contestId);
        totalContests = totalContests.add(1);
        
        emit ContestCreated(
            contestId,
            address(newContest),
            msg.sender,
            netPoolAmount,
            minEntriesRequired,
            duration
        );
        
        emit ContestFeeCollected(contestId, platformFee);
        
        return address(newContest);
    }

    /**
     * @dev Get contest address by ID
     * @param contestId Contest ID
     * @return contestAddress Contest contract address
     */
    function getContest(uint256 contestId) external view returns (address contestAddress) {
        require(contestId < totalContests, "ContestFactory: Contest does not exist");
        return contests[contestId];
    }

    /**
     * @dev Get user's contests
     * @param user User address
     * @return contestIds Array of contest IDs created by user
     */
    function getUserContests(address user) external view returns (uint256[] memory contestIds) {
        return userContests[user];
    }

    /**
     * @dev Get contest count
     * @return count Total number of contests created
     */
    function getContestCount() external view returns (uint256 count) {
        return totalContests;
    }

    /**
     * @dev Update platform wallet (only owner)
     * @param _platformWallet New platform wallet address
     */
    function updatePlatformWallet(address _platformWallet) 
        external 
        onlyOwner 
        validAddress(_platformWallet)
    {
        address oldWallet = platformWallet;
        platformWallet = _platformWallet;
        emit PlatformWalletUpdated(oldWallet, _platformWallet);
    }

    /**
     * @dev Update DEPE price for USD conversion (only owner)
     * @param _depePriceUSD New DEPE price in USD (18 decimals)
     */
    function updateDEPEPrice(uint256 _depePriceUSD) external onlyOwner {
        require(_depePriceUSD > 0, "ContestFactory: Invalid price");
        uint256 oldPrice = depePriceUSD;
        depePriceUSD = _depePriceUSD;
        emit DEPEPriceUpdated(oldPrice, _depePriceUSD);
    }

    /**
     * @dev Calculate minimum pool amount in DEPE
     * @return minPoolDEPE Minimum pool amount in DEPE tokens
     */
    function getMinPoolAmount() external view returns (uint256 minPoolDEPE) {
        return MIN_POOL_USD.mul(10**18).div(depePriceUSD);
    }

    /**
     * @dev Calculate platform fee for a given pool amount
     * @param poolAmount Pool amount in DEPE
     * @return platformFee Platform fee in DEPE
     */
    function calculatePlatformFee(uint256 poolAmount) external pure returns (uint256 platformFee) {
        return poolAmount.mul(PLATFORM_FEE_BPS).div(10000);
    }

    /**
     * @dev Pause factory (only owner)
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause factory (only owner)
     */
    function unpause() external onlyOwner {
        _unpause();
    }

    /**
     * @dev Emergency withdraw DEPE tokens (only owner)
     * @param amount Amount to withdraw
     */
    function emergencyWithdraw(uint256 amount) external onlyOwner nonReentrant {
        require(
            IERC20(depeToken).transfer(owner(), amount),
            "ContestFactory: Emergency withdraw failed"
        );
    }

    /**
     * @dev Get factory information
     * @return factoryTotalContests Total contests created
     * @return factoryMinPoolUSD Minimum pool in USD
     * @return factoryDepePriceUSD Current DEPE price in USD
     * @return factoryPlatformFeeBPS Platform fee in basis points
     */
    function getFactoryInfo() 
        external 
        view 
        returns (
            uint256 factoryTotalContests,
            uint256 factoryMinPoolUSD,
            uint256 factoryDepePriceUSD,
            uint256 factoryPlatformFeeBPS
        ) 
    {
        return (
            totalContests,
            MIN_POOL_USD,
            depePriceUSD,
            PLATFORM_FEE_BPS
        );
    }
}

contracts/ContestInstance.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
// Using existing DEPE token at 0x37e0f2d2340968981ed82d47c0112b1619dc5b07

/**
 * @title Contest Instance Contract
 * @dev Individual contest contract for DEPE meme contests
 * @author DEPE Team
 * 
 * Features:
 * - Contest lifecycle management
 * - Meme submission handling
 * - Voting system with DEPE tokens
 * - Staking system with pro-rata rewards
 * - Automatic reward distribution
 * - Security features and access controls
 */
contract ContestInstance is Ownable, ReentrancyGuard, Pausable {
    using SafeMath for uint256;

    // Contest phases
    enum ContestPhase { SUBMISSION, VOTING, ENDED, FAILED }
    
    // Contest configuration
    address public depeToken; // Existing DEPE token at 0x37e0f2d2340968981ed82d47c0112b1619dc5b07
    address public creator;
    uint256 public memePoolAmount;
    uint256 public stakingPoolAmount;
    uint256 public minEntriesRequired;
    uint256 public contestDuration;
    uint256 public submissionDeadline;
    uint256 public votingDeadline;
    
    // Contest details
    string public title;
    string public description;
    ContestPhase public phase;
    
    // Submission tracking
    uint256 public submissionCount;
    mapping(uint256 => Submission) public submissions;
    mapping(address => uint256[]) public userSubmissions;
    
    // Voting tracking
    mapping(uint256 => uint256) public submissionVotes;
    mapping(uint256 => uint256) public submissionVoteAmount;
    mapping(address => mapping(uint256 => bool)) public hasVoted;
    mapping(address => uint256) public userVoteAmount;
    
    // Staking tracking
    mapping(uint256 => Stake[]) public submissionStakes;
    mapping(address => mapping(uint256 => uint256)) public userStakeAmount;
    mapping(address => uint256[]) public userStakes;
    
    // Winner tracking
    uint256 public winningSubmissionId;
    bool public rewardsDistributed;
    
    // Voting requirements
    uint256 public constant MIN_VOTE_USD = 1 * 10**18; // $1 USD minimum
    uint256 public constant MAX_VOTE_USD = 10 * 10**18; // $10 USD maximum
    uint256 public depePriceUSD = 0.0014 * 10**18; // $0.0014 per DEPE (example)
    
    // Reward distribution
    uint256 public constant MEME_WINNER_PERCENT = 90; // 90% to meme winner
    uint256 public constant CONTEST_CREATOR_PERCENT = 20; // 20% to contest creator
    uint256 public constant STAKERS_PERCENT = 80; // 80% to stakers
    
    // Structs
    struct Submission {
        address submitter;
        string memeUrl;
        string memeType;
        string title;
        string description;
        uint256 voteCount;
        uint256 totalVoteAmount;
        uint256 stakeCount;
        uint256 totalStakeAmount;
        bool exists;
        uint256 createdAt;
    }
    
    struct Vote {
        address voter;
        uint256 amount;
        uint256 timestamp;
    }
    
    struct Stake {
        address staker;
        uint256 amount;
        uint256 timestamp;
        bool claimed;
    }
    
    // Events
    event ContestCreated(
        address indexed creator,
        uint256 memePoolAmount,
        uint256 minEntriesRequired,
        uint256 duration
    );
    event SubmissionAdded(
        uint256 indexed submissionId,
        address indexed submitter,
        string memeUrl
    );
    event VoteCast(
        uint256 indexed submissionId,
        address indexed voter,
        uint256 amount
    );
    event StakePlaced(
        uint256 indexed submissionId,
        address indexed staker,
        uint256 amount
    );
    event PhaseChanged(ContestPhase oldPhase, ContestPhase newPhase);
    event WinnerDetermined(uint256 indexed submissionId);
    event RewardsDistributed(
        uint256 indexed submissionId,
        uint256 memeWinnerReward,
        uint256 contestCreatorReward,
        uint256 stakersReward
    );
    event ContestFailed(uint256 reason); // 1 = not enough entries, 2 = no votes

    // Modifiers
    modifier onlyCreator() {
        require(msg.sender == creator, "ContestInstance: Only contest creator");
        _;
    }

    modifier onlyDuringSubmission() {
        require(phase == ContestPhase.SUBMISSION, "ContestInstance: Not in submission phase");
        require(block.timestamp <= submissionDeadline, "ContestInstance: Submission deadline passed");
        _;
    }

    modifier onlyDuringVoting() {
        require(phase == ContestPhase.VOTING, "ContestInstance: Not in voting phase");
        require(block.timestamp <= votingDeadline, "ContestInstance: Voting deadline passed");
        _;
    }

    modifier onlyAfterVoting() {
        require(phase == ContestPhase.ENDED, "ContestInstance: Contest not ended");
        _;
    }

    modifier validSubmission(uint256 submissionId) {
        require(submissions[submissionId].exists, "ContestInstance: Submission does not exist");
        _;
    }

    /**
     * @dev Constructor
     * @param _depeToken DEPE token contract address
     * @param _creator Contest creator address
     * @param _memePoolAmount Meme pool amount in DEPE
     * @param _minEntriesRequired Minimum entries required
     * @param _duration Contest duration in seconds
     * @param _title Contest title
     * @param _description Contest description
     */
    constructor(
        address _depeToken,
        address _creator,
        uint256 _memePoolAmount,
        uint256 _minEntriesRequired,
        uint256 _duration,
        string memory _title,
        string memory _description
    ) {
        require(_depeToken != address(0), "ContestInstance: Invalid DEPE token");
        require(_creator != address(0), "ContestInstance: Invalid creator");
        require(_memePoolAmount > 0, "ContestInstance: Invalid meme pool amount");
        require(_minEntriesRequired >= 1, "ContestInstance: Invalid min entries");
        require(_duration > 0, "ContestInstance: Invalid duration");
        
        depeToken = _depeToken;
        creator = _creator;
        memePoolAmount = _memePoolAmount;
        minEntriesRequired = _minEntriesRequired;
        contestDuration = _duration;
        title = _title;
        description = _description;
        
        // Set deadlines (submission phase is 60% of total duration)
        uint256 submissionDuration = _duration.mul(60).div(100);
        submissionDeadline = block.timestamp.add(submissionDuration);
        votingDeadline = block.timestamp.add(_duration);
        
        phase = ContestPhase.SUBMISSION;
        
        emit ContestCreated(_creator, _memePoolAmount, _minEntriesRequired, _duration);
    }

    /**
     * @dev Add a meme submission
     * @param memeUrl URL of the meme
     * @param memeType Type of meme (image/video)
     * @param submissionTitle Title of the submission
     * @param submissionDescription Description of the submission
     */
    function addSubmission(
        string memory memeUrl,
        string memory memeType,
        string memory submissionTitle,
        string memory submissionDescription
    ) external onlyDuringSubmission nonReentrant {
        require(bytes(memeUrl).length > 0, "ContestInstance: Invalid meme URL");
        require(bytes(memeType).length > 0, "ContestInstance: Invalid meme type");
        
        uint256 submissionId = submissionCount;
        submissions[submissionId] = Submission({
            submitter: msg.sender,
            memeUrl: memeUrl,
            memeType: memeType,
            title: submissionTitle,
            description: submissionDescription,
            voteCount: 0,
            totalVoteAmount: 0,
            stakeCount: 0,
            totalStakeAmount: 0,
            exists: true,
            createdAt: block.timestamp
        });
        
        userSubmissions[msg.sender].push(submissionId);
        submissionCount = submissionCount.add(1);
        
        emit SubmissionAdded(submissionId, msg.sender, memeUrl);
    }

    /**
     * @dev Vote for a submission
     * @param submissionId ID of the submission to vote for
     * @param voteAmount Amount of DEPE to vote with
     */
    function vote(uint256 submissionId, uint256 voteAmount) 
        external 
        onlyDuringVoting 
        validSubmission(submissionId)
        nonReentrant 
    {
        // Calculate minimum vote in DEPE based on USD limit
        uint256 minVoteDEPE = MIN_VOTE_USD.mul(10**18).div(depePriceUSD);
        require(voteAmount >= minVoteDEPE, "ContestInstance: Vote amount too low");
        
        // Calculate maximum vote in DEPE based on USD limit
        uint256 maxVoteDEPE = MAX_VOTE_USD.mul(10**18).div(depePriceUSD);
        require(voteAmount <= maxVoteDEPE, "ContestInstance: Vote amount too high");
        
        require(!hasVoted[msg.sender][submissionId], "ContestInstance: Already voted for this submission");
        
        // Transfer DEPE tokens from voter
        require(
            IERC20(depeToken).transferFrom(msg.sender, address(this), voteAmount),
            "ContestInstance: Vote transfer failed"
        );
        
        // Update voting records
        hasVoted[msg.sender][submissionId] = true;
        submissionVotes[submissionId] = submissionVotes[submissionId].add(1);
        submissionVoteAmount[submissionId] = submissionVoteAmount[submissionId].add(voteAmount);
        userVoteAmount[msg.sender] = userVoteAmount[msg.sender].add(voteAmount);
        
        // Add to staking pool (voting goes to staking pool)
        stakingPoolAmount = stakingPoolAmount.add(voteAmount);
        
        // Update submission
        submissions[submissionId].voteCount = submissions[submissionId].voteCount.add(1);
        submissions[submissionId].totalVoteAmount = submissions[submissionId].totalVoteAmount.add(voteAmount);
        
        emit VoteCast(submissionId, msg.sender, voteAmount);
    }

    /**
     * @dev Stake on a submission
     * @param submissionId ID of the submission to stake on
     * @param stakeAmount Amount of DEPE to stake
     */
    function stake(uint256 submissionId, uint256 stakeAmount) 
        external 
        onlyDuringSubmission 
        validSubmission(submissionId)
        nonReentrant 
    {
        require(stakeAmount > 0, "ContestInstance: Invalid stake amount");
        
        // Transfer DEPE tokens from staker
        require(
            IERC20(depeToken).transferFrom(msg.sender, address(this), stakeAmount),
            "ContestInstance: Stake transfer failed"
        );
        
        // Add stake
        submissionStakes[submissionId].push(Stake({
            staker: msg.sender,
            amount: stakeAmount,
            timestamp: block.timestamp,
            claimed: false
        }));
        
        userStakeAmount[msg.sender][submissionId] = userStakeAmount[msg.sender][submissionId].add(stakeAmount);
        userStakes[msg.sender].push(submissionId);
        
        // Update submission
        submissions[submissionId].stakeCount = submissions[submissionId].stakeCount.add(1);
        submissions[submissionId].totalStakeAmount = submissions[submissionId].totalStakeAmount.add(stakeAmount);
        
        // Add to staking pool
        stakingPoolAmount = stakingPoolAmount.add(stakeAmount);
        
        emit StakePlaced(submissionId, msg.sender, stakeAmount);
    }

    /**
     * @dev End submission phase and start voting (only creator)
     */
    function endSubmissionPhase() external onlyCreator {
        require(phase == ContestPhase.SUBMISSION, "ContestInstance: Not in submission phase");
        require(block.timestamp >= submissionDeadline, "ContestInstance: Submission phase not ended");
        
        if (submissionCount >= minEntriesRequired) {
            phase = ContestPhase.VOTING;
            emit PhaseChanged(ContestPhase.SUBMISSION, ContestPhase.VOTING);
        } else {
            phase = ContestPhase.FAILED;
            emit ContestFailed(1); // Not enough entries
            // Refund meme pool to creator
            if (memePoolAmount > 0) {
                IERC20(depeToken).transfer(creator, memePoolAmount);
            }
        }
    }

    /**
     * @dev End voting phase and determine winner (only creator)
     */
    function endVotingPhase() external onlyCreator {
        require(phase == ContestPhase.VOTING, "ContestInstance: Not in voting phase");
        require(block.timestamp >= votingDeadline, "ContestInstance: Voting phase not ended");
        
        if (submissionCount == 0) {
            phase = ContestPhase.FAILED;
            emit ContestFailed(2); // No submissions
            // Refund meme pool to creator
            if (memePoolAmount > 0) {
                IERC20(depeToken).transfer(creator, memePoolAmount);
            }
            return;
        }
        
        // Determine winner (highest vote count)
        uint256 maxVotes = 0;
        uint256 winnerId = 0;
        
        for (uint256 i = 0; i < submissionCount; i++) {
            if (submissionVotes[i] > maxVotes) {
                maxVotes = submissionVotes[i];
                winnerId = i;
            }
        }
        
        winningSubmissionId = winnerId;
        phase = ContestPhase.ENDED;
        
        emit WinnerDetermined(winnerId);
        emit PhaseChanged(ContestPhase.VOTING, ContestPhase.ENDED);
        
        // Automatically distribute rewards
        distributeRewards();
    }

    /**
     * @dev Distribute rewards to winners
     */
    function distributeRewards() public onlyAfterVoting {
        require(!rewardsDistributed, "ContestInstance: Rewards already distributed");
        
        rewardsDistributed = true;
        
        // Distribute meme pool (90% to winner, 10% to platform)
        uint256 platformFee = memePoolAmount.mul(10).div(100);
        uint256 memeWinnerReward = memePoolAmount.sub(platformFee);
        
        if (memeWinnerReward > 0) {
            IERC20(depeToken).transfer(submissions[winningSubmissionId].submitter, memeWinnerReward);
        }
        
        // Distribute staking pool (20% to creator, 80% to stakers)
        uint256 contestCreatorReward = stakingPoolAmount.mul(CONTEST_CREATOR_PERCENT).div(100);
        uint256 stakersReward = stakingPoolAmount.sub(contestCreatorReward);
        
        if (contestCreatorReward > 0) {
            IERC20(depeToken).transfer(creator, contestCreatorReward);
        }
        
        if (stakersReward > 0) {
            distributeStakingRewards(stakersReward);
        }
        
        emit RewardsDistributed(winningSubmissionId, memeWinnerReward, contestCreatorReward, stakersReward);
    }

    /**
     * @dev Distribute staking rewards to winning stakers
     * @param totalReward Total reward amount for stakers
     */
    function distributeStakingRewards(uint256 totalReward) internal {
        Stake[] storage winningStakes = submissionStakes[winningSubmissionId];
        uint256 totalStakeAmount = 0;
        
        // Calculate total stake amount for winning submission
        for (uint256 i = 0; i < winningStakes.length; i++) {
            totalStakeAmount = totalStakeAmount.add(winningStakes[i].amount);
        }
        
        // Distribute proportionally
        for (uint256 i = 0; i < winningStakes.length; i++) {
            Stake storage currentStake = winningStakes[i];
            uint256 stakerReward = totalReward.mul(currentStake.amount).div(totalStakeAmount);
            
            if (stakerReward > 0) {
                IERC20(depeToken).transfer(currentStake.staker, stakerReward);
                currentStake.claimed = true;
            }
        }
    }

    /**
     * @dev Get contest information
     * @return contestCreator Contest creator address
     * @return contestMemePoolAmount Meme pool amount
     * @return contestStakingPoolAmount Staking pool amount
     * @return contestMinEntriesRequired Minimum entries required
     * @return contestSubmissionCount Submission count
     * @return contestPhase Current contest phase
     * @return contestSubmissionDeadline Submission deadline
     * @return contestVotingDeadline Voting deadline
     * @return contestWinningSubmissionId Winning submission ID
     * @return contestRewardsDistributed Rewards distributed status
     */
    function getContestInfo() external view returns (
        address contestCreator,
        uint256 contestMemePoolAmount,
        uint256 contestStakingPoolAmount,
        uint256 contestMinEntriesRequired,
        uint256 contestSubmissionCount,
        ContestPhase contestPhase,
        uint256 contestSubmissionDeadline,
        uint256 contestVotingDeadline,
        uint256 contestWinningSubmissionId,
        bool contestRewardsDistributed
    ) {
        return (
            creator,
            memePoolAmount,
            stakingPoolAmount,
            minEntriesRequired,
            submissionCount,
            phase,
            submissionDeadline,
            votingDeadline,
            winningSubmissionId,
            rewardsDistributed
        );
    }

    /**
     * @dev Get submission information
     * @param submissionId Submission ID
     * @return submission Submission information
     */
    function getSubmission(uint256 submissionId) external view returns (Submission memory submission) {
        require(submissions[submissionId].exists, "ContestInstance: Submission does not exist");
        return submissions[submissionId];
    }

    /**
     * @dev Get user's submissions
     * @param user User address
     * @return submissionIds Array of submission IDs
     */
    function getUserSubmissions(address user) external view returns (uint256[] memory submissionIds) {
        return userSubmissions[user];
    }

    /**
     * @dev Get user's stakes
     * @param user User address
     * @return submissionIds Array of submission IDs staked on
     */
    function getUserStakes(address user) external view returns (uint256[] memory submissionIds) {
        return userStakes[user];
    }

    /**
     * @dev Check if user has voted for submission
     * @param user User address
     * @param submissionId Submission ID
     * @return userHasVoted True if user has voted
     */
    function hasUserVoted(address user, uint256 submissionId) external view returns (bool userHasVoted) {
        return hasVoted[user][submissionId];
    }

    /**
     * @dev Get submission stakes
     * @param submissionId Submission ID
     * @return stakes Array of stakes for the submission
     */
    function getSubmissionStakes(uint256 submissionId) external view returns (Stake[] memory stakes) {
        return submissionStakes[submissionId];
    }

    /**
     * @dev Update DEPE price (only owner)
     * @param _depePriceUSD New DEPE price in USD
     */
    function updateDEPEPrice(uint256 _depePriceUSD) external onlyOwner {
        require(_depePriceUSD > 0, "ContestInstance: Invalid price");
        depePriceUSD = _depePriceUSD;
    }

    /**
     * @dev Pause contest (only owner)
     */
    function pause() external onlyOwner {
        _pause();
    }

    /**
     * @dev Unpause contest (only owner)
     */
    function unpause() external onlyOwner {
        _unpause();
    }
}

